import ExpenseItem from './component/ExpenseItem';

function App() {
  const expenses = [
    { title: "Car Insuarance", amount: 294, date: new Date(2023, 3, 4) },
    { title: "Car Insuarance", amount: 294, date: new Date(2023, 3, 4) },
    { title: "Car Insuarance", amount: 294, date: new Date(2023, 3, 4) },
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
      title={expenses[0].title}
      amount={expenses[0].amount}
      date={expenses[0].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
